import Navbar from "../components/Navbar";
import classes from "../styles/Services.module.css";
import safe from "../images/safe-space.png";

import Footer from "../components/Footer"


export default function Services() {
  const background = {
    backgroundImage: "url(" +
        "https://images.pexels.com/photos/1166644/pexels-photo-1166644.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1.jpg" + ")",
    width: '100%',
    height: '200px',
    justifyItems: 'end',
  };

  return (
    <div>
      <Navbar />
      <div className={classes.header} style={background}>
        <div className={`${classes.individual} ${classes.nanumMyeongjoRegular}`}><h1>Individual Therapy</h1></div>
        <img className={classes.safeImg} src={safe} />
      </div>
      <Footer />
    </div>
  )
}
